import React,{useState} from 'react'
import MenuItems from './MenuItems.js'
import styles from './Navbar.module.css'

const Navbar = () => {
    const [clicked, setClicked] = useState(false); 


    return(
        <div className={styles["Navbar"]}>
            <label className={styles["navbar-title"]}>THE FALSE 9</label>
            <nav>
                <div className={styles["navigation"]}>
                <ul className={clicked?`${styles["nav-links-list"]} ${styles["nav-links-list-active"]}`:`${styles["nav-links-list"]} ${styles["nav-links-list-inactive"]}`}>
                    {MenuItems.map((item, index) => {return <li key={index} className={index%2===0?`${styles["list-item"]} ${styles["list-item-even"]}`:`${styles["list-item"]} ${styles["list-item-odd"]}`}><a className={styles[item.className]} href={item.url}>{item.title.toUpperCase()}</a></li>;})}
                </ul>
                <ul className={styles["social-links"]}>
                    <li><i className={clicked?`${styles["fas"]} ${styles["fa-times"]}`:`${styles["fas"]} ${styles["fa-bars"]}`} onClick={()=> {setClicked(!clicked);}}/></li>
                    <li><a href=""><i className={`${styles["fab"]} ${styles["fa-facebook-f"]} fab fa-facebook-f`}/></a></li>
                    <li><a href=""><i className={`${styles["fab"]} ${styles["fa-twitter"]} fab "fa-twitter"`}/></a></li>
                    <li><a href=""><i className="fab fa-youtube"/></a></li>
                </ul>
                </div>
            </nav>
        </div>
    );
};

export default Navbar;
